         <View style={{ alignItems: 'center', marginLeft: 50, marginTop: 20 }}>
           { <Avatar
               rounded={true}
               size="medium"
               source={{
                  uri: 'http://proj.ruppin.ac.il/bgroup15/prod/finalPics/avatar.jpg',
               }}
               icon={{ name: 'user', type: 'font-awesome' }}
            />}
            <Text>הירשם</Text>
         </View>
      </TouchableOpacity>
   )
}
export default FCAvatar;
